import React, { Component } from 'react';
import './shoprecord.css';

class ShopRecord extends Component  {

    constructor(props){
        super(props);

        this.state = {
            user : []
        }
    }

    componentDidMount(){
        const options = {
            headers : {
                "x-auth-token": "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..zMMWC4Oi7PUvKBmgwANuaHzu_596wX0kfGxost5CS18"
            }
        }
        fetch("http://localhost:5050/auth", options).then(response => response.json()).then(result => {
            const newUser = result.user;
        }).catch(err => console.log(err));
    }

    render(){
        return (
            <div className="shoprecord">
                <table class="table table-bordered">
                    <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">First</th>
                            <th scope="col">Last</th>
                            <th scope="col">Handle</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <th scope="row">1</th>
                            <td>{this.state.user.first_name}</td>
                            <td>{this.state.user.last_name}</td>
                            <td>@mdo</td>
                        </tr>
                        <tr>
                            <th scope="row">2</th>
                            <td>Jacob</td>
                            <td>Thornton</td>
                            <td>@fat</td>
                        </tr>
                        <tr>
                            <th scope="row">3</th>
                            <td colspan="2">Larry Bird</td>
                            <td>@twitter</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        )
    }
}

export default ShopRecord;
